import MealItemForm from "./MealItemForm"
import classes from './MealItems.module.css'

const MealItems = (props) => {
    return(
        <><li>
            <div>
                <h3>{props.name}</h3>
            </div>
            <div className={classes.description}>
                {props.description}
            </div>
            <div className={classes.price}>
                {props.price}
            </div>

        </li><MealItemForm /></>
    )
}

export default MealItems
